import React from 'react';

const FooterCopyright = () => {
    return (
        <div className="ps-copyright">
            <img style={{ marginLeft: -25 }} src="/img/logo.png" alt="" />
            <p>
                &copy;2020 Cypher's Technolabs. <br /> All rights reversed.
            </p>
        </div>
    );
};

export default FooterCopyright;
